import { Component, OnInit } from "@angular/core";
import { ActivatedRoute, Router } from "@angular/router";
import { NgbCarouselConfig } from "@ng-bootstrap/ng-bootstrap";
import { Subscription } from "rxjs";
import { ContentfulService } from "src/app/services/contentful.service";

@Component({
  selector: "app-tours",
  templateUrl: "./tours.component.html",
  styleUrls: ["./tours.component.scss"],
  providers: [NgbCarouselConfig],
})
export class ToursComponent implements OnInit {
  private routeSub: Subscription | undefined;
  constructor(
    private route: ActivatedRoute,
    private contentfulService: ContentfulService,
    private router: Router,
    config: NgbCarouselConfig
  ) {
    config.showNavigationArrows = true;
    config.showNavigationIndicators = true;
  }

  tourId!: string;
  isDataTour: boolean = false;
  tour: any = {};

  ngOnInit() {
    // clean variables
    this.tour = {};
    this.tourId = "";
    this.isDataTour = false;

    this.routeSub = this.route.params.subscribe((params) => {
      this.tourId = params["id"];
      // console.log(this.tourId); //log the value of id
    });

    this.getData();
  }

  async getData() {
    this.tour = await this.contentfulService.getProduct(this.tourId);
    this.isDataLoaded(this.tour);
    console.log("tour: ", this.tour);
  }

  isDataLoaded(data: any) {
    if (data != undefined && data != null) {
      this.isDataTour = true;
    } else {
      this.isDataTour = false;
    }
  }

  navigate() {
    this.router.navigate(["/contact"]);
  }
}
<div>
  <div class="tour-header mt-5 mx-3">
    <h1>At Playa Colorada we offer you the best tours</h1>
    <p>Do not hesitate to contact us!</p>
  </div>
  <div class="skeleton mt-5" *ngIf="!this.isDataTour">
    <ngx-skeleton-loader appearance="line"></ngx-skeleton-loader>
    <ngx-skeleton-loader appearance="line"></ngx-skeleton-loader>
    <br />
    <ngx-skeleton-loader appearance="line"></ngx-skeleton-loader>
  </div>
  <div class="data-tour" *ngIf="this.isDataTour">
    <h2>{{ tour.title }}</h2>
    <br />
    <p>{{ tour.description }}</p>
    <br />
    <p class="font-weight-bold">Rutas:</p>
    <div class="routes-info">
      <p *ngFor="let route of tour.routes; let i = index">
        {{ route }}:
        <span class="text-decoration-line">${{ tour.prices[i] }}</span>
      </p>
    </div>
    <br />
    <hr size="30" noshade class="line" />
    <br />
    <div class="tour-img">
      <!-- <img src="{{ tour.imagesM.fields.file.url }}" alt="Tour Imagen" class="" /> -->
    </div>
    <ngb-carousel>
      <ng-template *ngFor="let images of tour.imagesM" ngbSlide>
        <img src="{{ images.fields.file.url }}" alt="Delhi Metro" />
        <div class="carousel-caption">
          <h3 style="color: yellow">Delhi Metro</h3>
        </div>
      </ng-template>
    </ngb-carousel>
    <br />
    <div class="wrap mt-5">
      <button class="button" (click)="navigate()">Contactanos</button>
    </div>
  </div>
</div>
